    public synchronized T get(URL url) throws IOException {
        if (url == null) {
            throw new IllegalArgumentException("URL must not be null");
        }

        Optional<byte[]> content = Optional.empty();
        try {
            content = cache.get(url, () -> Optional.of(getContent(url)));
